import React from 'react';
import Navbar from '../navSection/Navbar';
import Map from '../component/Map';
import HouseOutlinedIcon from '@mui/icons-material/HouseOutlined';

function HomePage() {
    const data = [
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: true,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    imgs: 'https://cdn.filestackcontent.com/5ngAPL80SuCvpsEb7S2f',
  },
  {
    name: 'amala and ewedu',
    desc: 'hot delicious amala and ewedu',
    content: [
      '1 chicken lap',
      'a bow of soup',
      '2 wraps of amala',
      '4 pieces of beef',
    ],
    price: 700,
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 1.5,
    verified: true,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    img: 'https://www.shutterstock.com/image-photo/top-view-meal-nigerian-amala-600nw-1386416945.jpg',
  },
];
  return (
    <div>
      <Navbar />
      <Map />
      <div className='my-3 d-flex justify-content-center'>
        {' '}
        <h3 className='border-bottom border-secondary'>We diliver to your door-step<HouseOutlinedIcon className='fs-1 text-success'/></h3>

      </div>
    </div>
  );
}

export default HomePage;
